import { useState } from "react";
import { useNavigate } from 'react-router-dom';
import background from "../pages/cool-background.png";


function App() {
  const history = useNavigate()
  const [name, setName] = useState('')
  const [email, setEmail] = useState('')
  const [password, setPassword] = useState('')
  const [balance] = useState('')

  async function populateName() {
    const req = await fetch('http://localhost:1337/api/name', {
        headers: {
            'x-access-token': localStorage.getItem('token'),
        },
    })

    const data = await req.json()
    if(data.status === 'ok') {
        displayName(data.name)
    } else {
        alert(data.error)
    }
}

useEffect(() => {
    const token = localStorage.getItem('token')
    if (token) {
        const user = jwt.decode(token)
        if(!user) {
            localStorage.removeItem('token')
            history.replace('/login')
        } else {
            populateName()
        }
    }
})



  async function  logOut() {
    localStorage.clear();
    window.location.href = '/home';
}


  return (

    <div class="site-wrap" >

<header class="site-navbar js-sticky-header site-navbar-target" role="banner">
          
          <div class="container">
            <div class="row align-items-center">
              
              <div class="col-6 col-xl-2">
                <h1 class="mb-0 site-logo"><a href="home" class="h2 mb-0">AioMax<span class="text-primary">Bank</span> </a></h1>
              </div>
        
              <div class="col-12 col-md-10 d-none d-xl-block">
                <nav class="site-navigation position-relative text-right" role="navigation">
        
                  <ul class="site-menu main-menu js-clone-nav mr-auto d-none d-lg-block">
                  <li><a>Transfer</a></li>
                    <li class="has-children">
                      <a href="#about-section" class="nav-link">{name}</a>
                      <ul class="dropdown">
                        <li><a href="/dashboard" class="nav-link">Dashboard</a></li>
                        <li><a href="/transfer" class="nav-link">Transfer</a></li>
                        <li><a onClick={logOut} class="nav-link">Log Out</a></li>
                      </ul>
                    </li>
                  </ul>
                </nav>
              </div>
            </div>
          </div>
          
        </header>
    
    <div class="site-blocks-cover overlay"style={{ backgroundImage: `url(${background})` }} data-aos="fade" id="home-section">
            <div class="container">
            <div class="row align-items-center justify-content-center">
              <div class="col-md-10 mt-lg-5 text-center">
                 
              </div>
            </div>
          </div>
    <div class="register-or-login">
    <div class="test1 overlay" data-aos="fade" id="home-section">
    <div class="container">
    <div class="row align-items-center justify-content-center">
    <div class="col-md-12 mt-lg-5 text-center">
      <h1 class="form__title">Settings</h1>
      <form class="form" id="login" onSubmit={registerUser}>
        <input class="form__input"
          value={name}
          onChange={(e) => setName(e.target.value)}
          type="text"
          autofocus placeholder="Name"
        /><br />
        <input class="form__input"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          type="text"
          autofocus placeholder="Email"
        /><br />
        <input class="form__input"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          type="password"
          autofocus placeholder="Password"
        /><br />
        <button class="form__button" type="submit">Continue</button>
        <p class="form__text">
                <a class="form__link" href="login" id="linkLogin">Already have an account? Sign in</a>
        </p>
      </form>
      </div>
    </div>
    </div>
    </div>
    </div>
    </div>
    </div>
  );

}

export default App;
